/* eslint-disable jsx-a11y/alt-text */
import { useState, useEffect } from "react";
import "./App.css";
function App() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8000/data")
      .then((res) => {
        return res.json();
      })
      .then((db) => {
        setData(db.advisorProfileCollection.items);
      });
  }, []);
  if (data) {
    data.map((item) => {
      if (item.avatarUrl && item.avatarUrl.url) {
        console.log(item.avatarUrl.url);
      }
    });
  }
  return <>
  {data&&data.map((item) => {
      if (item.avatarUrl && item.avatarUrl.url) {
        img(item.avatarUrl.url);
      }
    })}
  </>;
}

export default App;
